import React, { Component } from 'react'

export default class Count extends Component {
  render() {
    return (
      <div>
         <select name="" id="">
           <option value="1">1</option>
           <option value="2">2</option>
           <option value="3">3</option>
         </select>&nbsp;
         <button type='button' className='btn btn-primary'>点击加1</button>&nbsp;
         <button type='button' className='btn btn-primary'>点击减1</button>&nbsp;
         <button type='button' className='btn btn-primary'>只有奇数时才点击</button>&nbsp;
         <button type='button' className='btn btn-primary'>异步加</button>
      </div>
    )
  }
}
